// src/pages/CollectionsPage.jsx
import CollectionItem from "../components/CollectionItem";

const dummyData = [
  { title: "Modern Sofa Set", price: "$499" },
  { title: "Classic Recliner", price: "$299" },
  { title: "Minimalist Couch", price: "$399" },
  { title: "Family L-Shape Sofa", price: "$699" },
  { title: "Single Seater", price: "$199" },
  { title: "3-Seat Lounge", price: "$599" },
];

export default function CollectionsPage() {
  return (
    <div className="p-6 max-w-7xl mx-auto">
      <h1 className="text-3xl font-bold mb-6 text-center">Our Collections</h1>
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6">
        {dummyData.map((item, index) => (
          <CollectionItem key={index} title={item.title} price={item.price} />
        ))}
      </div>
    </div>
  );
}
